import React, { Component } from 'react';

import Product from './Product/Product';

export class Products extends Component {
  render() {
    return (
      <section>
        <h2>Наша продукция</h2>
        <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus sodales efficitur felis ac tristique. Etiam a lacus suscipit, fringilla justo eu, sagittis turpis. </p>
        <Product />
      </section>
    )
  }
}

export default Products
